INSERT INTO `produtos` (`id_produto`, `nome_produto`, `valor_produto`, `parcela_produto`, `valor_parcela_produto`, `brev_desc_produto`, `desc_completa_produto`, `marca`, `modelo`, `tipo_chip`, `tela`, `sistema_operacional`, `processador`, `memoria`, `banda`, `camera`, `foto_1`, `foto_2`, `foto_3`) VALUES
	(1, 'LG K4 LITE 8GB', 494.00, 24, 20.58, 'Dual Chip Tela 5.0"4G \r\nQuadcore Câmera 5 MP 8G\r\n', 'O LG K4 Novo é um smartphone Android mediano, ideal para quem não tem muitas exigências mas não abre mão de um bom display touchscreen. As funções oferecidas pelo LG K4 Novo são mais ou menos as mesmas oferecidas em outros dispositivos avançados, começando com a conectividade Wi-fi e GPS. Tem leitor multimídia, rádio, videoconferência e bluetooth. Enfatizamos a memória interna de 8 GB com a possibilidade de expansão. A transferência de dados e navegação web sao fornecidas pela rede UMTS, mas não suporta tecnologias mais recentes, tais como HSDPA. \r\nTem uma grande tela Touchscreen de 5 polegadas com uma resolução de 854x480 pixels. Ótima a câmera de 8 megapixels que permite ao LG K4 Novo tirar fotos fantásticas com uma resolução de 3264x2448 pixels e gravar vídeos em alta definição (Full HD) com uma resolução de 720x1280 pixels. Muito fino, 8.1 milímetros, o que torna o LG K4 Novo realmente bom para o transporte. (Cores corporativas conforme estoque, sem possibilidade de escolha)\r\n', 'LG', 'K4 Lite ', 'Dual Chip', '5.0" ', 'Android', 'Quadcore 1.1GHz ', '8GB', 'Wi-fi + 4G ', '13MP', 'LGK4_1.jpg', 'LGK4_3.jpg', 'LGK4_2.jpg'),
	(2, 'Novo LG K11 Plus 32GB', 982.00, 24, 40.92, 'Dual Chip Tela 5.3" \r\nOcta Core Câmera 13MP\r\n', 'O LG K11 Plus é um smartphone Android completo, que não tem muito a invejar aos mais avançados dispositivos. Tem uma enorme tela Touchscreen de 5.3 polegadas com uma resolução de 1280x720 pixel. Quanto às funções, no LG K11 Plus realmente não falta nada. Começando pelo conectividade Wi-fi e GPS. A transferência de dados e navegação web sao fornecidas pela rede UMTS, mas não suporta tecnologias mais recentes, tais como HSDPA. Enfatizamos a boa memória interna de 32 GB com a possibilidade de expansão. \nEste LG K11 Plus é um produto com poucos concorrentes em termos de multimídia graças à câmera de 13 megapixels que permite ao LG K11 Plus tirar fotos fantásticas com uma resolução de 4160x3120 pixels e gravar vídeos em alta definição (Full HD) com uma resolução de 1920x1080 pixels. Muito fino, 8.7 milímetros, o que torna o LG K11 Plus realmente interessante. (Cores corporativas conforme estoque, sem possibilidade de escolha).\n', 'LG', 'K11 Plus', 'Dual Chip', ' 5.3" ', 'Android', 'Octa Core 1.5 Ghz ', '32GB', 'Wi-fi + 4G ', '13MP', 'lgk11_1.jpg', 'lgk11_3.jpg', 'lgk11_2.jpg'),
	(3, 'Moto G6 PLAY 32GB', 1122.00, 24, 46.75, 'Dual Chip Tela 5.7" \r\nCâmera 13MP\r\n', 'O Motorola Moto G6 Play é um smartphone Android de bom nível, ótimo para fotos, que pode satisfazer até o mais exigente dos usuários. Tem uma grande tela Touchscreen de 5.7 polegadas com uma resolução de 1440x720 pixels. Sobre as características deste Motorola Moto G6 Play na verdade não falta nada. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS. Tem também leitor multimídia, rádio, videoconferência e bluetooth. Enfatizamos a boa memória interna de 32 GB com a possibilidade de expansão. \nO Motorola Moto G6 Play é um produto com poucos concorrentes em termos de multimídia graças à câmera de 13 megapixels que permite ao Motorola Moto G6 Play tirar fotos fantásticas com uma resolução de 4160x3120 pixels e gravar vídeos em alta definição (Full HD) com uma resolução de 1920x1080 pixels. Muito fino, 9 milímetros, o que torna o Motorola Moto G6 Play realmente interessante. (Cores corporativas conforme estoque, sem possibilidade de escolha).\n', 'Motorola', ' Moto G6 Play', 'Dual Chip', ' 5.7"', 'Android', 'Octa-Core 1.4 GHz', '32GB', 'Wi-fi + 4G ', '13MP', 'motog6play_1.png', 'motog6play_3.png', 'motog6play_2.png'),
	(4, 'SAMSUNG GALAXY J6 32GB', 1145.00, 24, 47.71, 'Dual Chip Tela 5.6" \r\nOcta-Core Câmera 13MP\r\n', 'O Samsung Galaxy J6 é um smartphone Android de bom nível, ótimo para fotos, que pode satisfazer até o mais exigente dos usuários. Tem uma grande tela Touchscreen de 5.6 polegadas com uma resolução de 1480x720 pixels. Sobre as características deste Samsung Galaxy J6 na verdade não falta nada. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS. Tem também leitor multimídia, rádio, videoconferência, TV e bluetooth. Enfatizamos a boa memória interna de 32 GB mas sem a possibilidade de expansão. \nO Samsung Galaxy J6 é um produto com poucos concorrentes em termos de multimídia graças à câmera de 13 megapixels que permite ao Samsung Galaxy J6 tirar fotos fantásticas com uma resolução de 4160x3120 pixels e gravar vídeos em alta definição (Full HD) com uma resolução de 1920x1080 pixels. Muito fino, 8.2 milímetros, o que torna o Samsung Galaxy J6 realmente interessante. (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Samsung ', 'Galaxy J6 ', 'Dual Chip', '5.6"', 'Android', 'Octa-Core 1.6GHz ', '32GB ', 'Wi-fi + 4G ', '13MP', 'samsungj6_1.jpg', 'samsungj6_3.jpg', 'samsungj6_2.jpg'),
	(5, 'SAMSUNG GALAXY J8 64GB', 1811.00, 24, 75.46, 'Dual Chip Tela 6" \r\nOcta-Core Câmera 16MP\r\n', 'O Samsung Galaxy J8 é um smartphone Android de bom nível, ótimo para fotos, que pode satisfazer até o mais exigente dos usuários. Tem uma enorme tela Touchscreen de 6 polegadas com uma resolução de 1480x720 pixel que não é das mais elevadas. Sobre as características deste Samsung Galaxy J8 na verdade não falta nada. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS. Tem também leitor multimídia, rádio, videoconferência e bluetooth. Enfatizamos a boa memória interna de 64 GB mas sem a possibilidade de expansão. \nO Samsung Galaxy J8 é um produto com poucos concorrentes em termos de multimídia graças à câmera de 16 megapixels e gravar vídeos em alta definição (Full HD) com uma resolução de 1080x1920 pixels. Muito fino, 8 milímetros, o que torna o Samsung Galaxy J8 realmente interessante. (Cores corporativas conforme estoque, sem possibilidade de escolha).', ' Samsung', 'Galaxy J8', 'Dual Chip', '6" ', 'Android', 'Octa-Core 1.8GHz ', '64GB ', 'Wi-fi + 4G ', '16MP', 'samsungj8_1.jpg', 'samsungj8_3.jpg', 'samsungj8_2.jpg'),
	(6, 'SAMSUNG GALAXY A8 64GB', 1968.00, 24, 82.00, 'Dual Chip Tela 5.6"\r\nOcta-Core Câmera 16MP\r\n', 'O Samsung Galaxy A8 é um smartphone Android de bom nível, ótimo para fotos, que pode satisfazer até o mais exigente dos usuários. Tem uma grande tela Touchscreen de 5.7 polegadas com uma boa resolução de 1920x1080 pixels. Sobre as características deste Samsung Galaxy A8 na verdade não falta nada. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS. Tem também leitor multimídia, rádio, videoconferência e bluetooth. Enfatizamos a boa memória interna de 32 GB com a possibilidade de expansão. \nO Samsung Galaxy A8 é um produto com poucos concorrentes em termos de multimídia graças à câmera de 16 megapixels que permite ao Samsung Galaxy A8 tirar fotos fantásticas com uma resolução de 5312x2988 pixels e gravar vídeos em alta definição (Full HD) com uma resolução de 1920x1080 pixels. Muito fino, 5.9 milímetros, o que torna o Samsung Galaxy A8 realmente interessante.  (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Samsung', ' Galaxy A8', 'Dual Chip', '5.6"', 'Android', 'Octa-Core 2.2GHz ', '64GB', 'Wi-fi + 4G ', '16MP', 'samsunga8_1.jpg', 'samsunga8_3.jpg', 'samsunga8_2.jpg'),
	(7, 'SAMSUNG GALAXY S8 64GB', 2917.00, 10, 291.70, 'Dual Chip Tela 5.8" \r\nOcta-Core Câmera 12MP\r\n', 'O Samsung Galaxy S8 é um smartphone Android com características inovadoras que o tornam uma excelente opção para qualquer tipo de utilização, representando um dos melhores dispositivos móveis já feitos. A tela de 5.8 polegadas coloca esse Samsung no topo de sua categoria. Além disso a resolução é das mais altas atualmente em circulação: 2960x1440 pixel. As funcionalidades oferecidas pelo Samsung Galaxy S8 são muitas e todas top de linha. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS presente no aparelho. Tem também leitor multimídia, videoconferência, e bluetooth. Enfatizamos a excelente memória interna de 64 GB com a possibilidade de expansão. \nCâmera de 12 megapixel. A espessura de apenas 8 milímetros torna o Samsung Galaxy S8 um dos telefones mais finos que existem. (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Samsung', 'Galaxy S8', 'Dual Chip', '5.8"', 'Android', 'Octa-Core 2.3GHz', '64GB', 'Wi-fi + 4G ', '12MP', 'samsungs8_1.png', 'samsungs8_3.jpg', 'samsungs8_2.jpg'),
	(8, 'IPHONE 7 32GB', 3202.00, 10, 320.20, 'Apple Single Chip 32 GB\r\nProcessador A10 Câmera 12MP\r\n', 'O Apple iPhone 7 é um dos smartphones iOS mais avançados e completos que existem em circulação. Tem um display de 4.7 polegadas com uma resolução de 1334x750 pixel. As funcionalidades oferecidas pelo Apple iPhone 7 são muitas e inovadoras. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet. Enfatizamos a excelente memória interna de 256 GB mas sem a possibilidade de expansão. \nCâmera discreta de 12 megapixel mas que permite ao Apple iPhone 7 tirar fotos de boa qualidade com uma resolução de 4608x2592 pixel e gravar vídeos em 4K a espantosa resolução de 3840x2160 pixels. A espessura de 7.1mm torna o Apple iPhone 7 um dos telefones mais completos e finos. (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Apple', 'iPhone 7', 'Single Chip', '4,7"', 'IOS', 'Apple A10 Fusion', '32GB', '\r\nWi-fi + 4G', ' 12MP', 'iphone7_1.jpg', 'iphone7_3.jpg', 'iphone7_2.jpg'),
	(9, 'SAMSUNG S9 128GB', 3520.00, 10, 352.00, 'Dual Chip Tela 6.2" \r\nOcta-Core Câmera 12MP\r\n', 'O Samsung Galaxy S9 é um smartphone Android com características inovadoras que o tornam uma excelente opção para qualquer tipo de utilização. A tela de 5.8 polegadas coloca esse Samsung no topo de sua categoria. Além disso a resolução é das mais altas atualmente em circulação: 2960x1440 pixel. As funcionalidades oferecidas pelo Samsung Galaxy S9 são muitas e top de linha. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS presente no aparelho. Tem também leitor multimídia, videoconferência, e bluetooth. Enfatizamos a excelente memória interna de 128 GB com a possibilidade de expansão. \nCâmera de 12 megapixel. A espessura de 8.5 milímetros é realmente ótima e torna o Samsung Galaxy S9 ainda mais espetacular. (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Samsung ', 'Galaxy S9', 'Dual Chip', '5.8"', 'Android', 'Octa-Core 2.8GHz', '128GB', 'Wi-fi + 4G ', ' 12MP', 'sansungs9_1.jpg', 'sansungs9_3.jpg', 'sansungs9_2.jpg'),
	(10, 'IPHONE 8 64GB', 3732.00, 10, 373.20, 'Apple Single Chip 64 GB\r\nProcessador A11 Câmera 12MP\r\n', 'O Apple iPhone 8 é um smartphone iOS com características inovadoras que o tornam uma excelente opção para qualquer tipo de utilização. A tela de 4.7 polegadas coloca esse Apple no topo de sua categoria. A resolução é de 1334x750 pixel. As funcionalidades oferecidas pelo Apple iPhone 8 são muitas e top de linha. Começando pelo LTE 4G que permite a transferência de dados e excelente navegação na internet, além de conectividade Wi-fi e GPS presente no aparelho. Tem também leitor multimídia, videoconferência, e bluetooth. Enfatizamos a excelente memória interna de 256 GB mas sem a possibilidade de expansão. \nCâmera de 12 megapixel. A espessura de apenas 7.3 milímetros torna o Apple iPhone 8 um dos telefones mais finos que existem. (Cores corporativas conforme estoque, sem possibilidade de escolha).', 'Apple', 'iPhone 8', 'Single Chip', '4,7"', 'IOS', 'Quad-core (Apple A10 Fusion)', '64GB', 'Wi-fi + 4G ', ' 12MP', 'iphone8_1.jpg', 'iphone8_3.jpg', 'iphone8_2.jpg');
